import React, { useEffect, useState } from 'react';
import { useCookies } from 'react-cookie';
import LocalizedStrings from 'react-localization';

import { View, useWindowDimensions } from 'react-native';
import { TopAppBarFixedAdjust } from '@material/react-top-app-bar';
import { DrawerAppContent } from '@material/react-drawer';
import { Cell, Grid, Row } from '@material/react-layout-grid';
import MaterialIcon from '@material/react-material-icon';
import '@material/react-layout-grid/dist/layout-grid.css';
import '@material/react-material-icon/dist/material-icon.css';

import MaterialTopAppBar from '../../components/horizontal-prototype/MaterialTopAppBar';
import MaterialDrawer from '../../components/horizontal-prototype/MaterialDrawer';
import MaterialFab from '../../components/horizontal-prototype/MaterialFab';
import MaterialSnackbar from '../../components/horizontal-prototype/MaterialSnackbar';
import RecipesCard from '../../components/horizontal-prototype/RecipesCard';

import { apiUrl } from '../../url';

const strings = new LocalizedStrings({
  en: {
    recipes: 'Recipes',
    servings: 'servings',
    minutes: 'minutes',
    toast_missing: 'Oops. Information is missing.',
    toast_created: 'Recipe created.',
    toast_edited: 'Recipe edited.',
    toast_favorited: 'Recipe favorited.',
    toast_added_to_cart: 'Recipe added to cart.',
  },
});

export default () => {
  const [cookies, setCookie] = useCookies(['session', 'userID']);
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [toast, setToast] = useState('');
  const [recipes, setRecipes] = useState([]);

  const dummySetup = () => {
    // TODO: hard code recipes array
    setRecipes([
      {
        title: 'Alfredo Pasta',
        subtitle: '1000',
        image: 'data:image/png;base64,',
      },
      {
        title: 'The Prefect Steak',
        subtitle: '1500',
        image: 'data:image/png;base64,',
      },
    ]);
  };

  const load = async () => {
    // await fetch(apiUrl + '/v4/recipes/list/favoried?session=' + cookies.session + '&userID=' + cookies.userID, {
    await fetch(`${apiUrl}/v4/recipes/list/all?session=${cookies.session}`, {
      method: 'get',
      headers: {
        Accept: 'application/json',
        'Content-Type': 'application/json',
      },
    })
      .then((res) => {
        if (!res.ok) {
          if (res.status !== 406) {
            throw new Error(`${res.status} ${res.statusText}`);
          } else {
            return null;
          }
        }
        return res.json();
      })
      .then(async (data) => {
        if (data !== null) {
          const recipes2 = data.map((item) => ({
            key: item.recipeID,
            title: item.title,
            subtitle: `${item.servings} ${strings.servings} | ${item.cookingTime} ${strings.minutes}`,
            image: item.image,
          }));
          setRecipes(recipes2);
        } else {
          setToast(strings.toast_missing);
        }
      })
      .catch((error) => setToast(error.toString()));
  };

  useEffect(() => {
    // dummySetup();
    load();
  }, []);

  const toggleDrawer = () => {
    setDrawerOpen(!drawerOpen);
  };

  const handleFavorite = async (value) => {
    await fetch(`${apiUrl}/v4/recipes/favorite`, {
      method: 'post',
      headers: {
        Accept: 'application/json',
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        session: cookies.session,
        userID: cookies.userID,
        recipeID: value,
      }),
    })
      .then((res) => {
        if (!res.ok) {
          throw new Error(`${res.status} ${res.statusText}`);
        }
      })
      .catch((error) => setToast(error.toString()));
    setToast(strings.toast_favorited);
    load();
  };

  const handleHistory = async () => {
    // TODO: fetch
  };

  const handleAddToCart = async (value) => {
    // TODO: fetch
    await fetch(`${apiUrl}/v4/carts/recipe`, {
      method: 'post',
      headers: {
        Accept: 'application/json',
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        session: cookies.session,
        userID: cookies.userID,
        recipeID: value,
      }),
    })
        .then((res) => {
          if (!res.ok) {
            throw new Error(`${res.status} ${res.statusText}`);
          }
        })
        .catch((error) => setToast(error.toString()));
    setToast(strings.toast_added_to_cart);
    load();
  };

  return (
    <View className="drawer-container">
      <MaterialTopAppBar
        title={strings.recipes}
        onClick1={toggleDrawer}
        onClick2={() => window.location.href = 'search/'}
      />
      <TopAppBarFixedAdjust className="top-app-bar-fix-adjust">
        <MaterialDrawer
          open={drawerOpen}
          selectedIndex={1}
          onClose={toggleDrawer}
        />
        <DrawerAppContent className="drawer-app-content">
          <Grid style={{ height: useWindowDimensions().height - 64 }}>
            {recipes.length > 0 && (
            <Row>
              {recipes.map((item) => (
                <Cell desktopColumns={6} phoneColumns={4} tabletColumns={4}>
                  <RecipesCard
                    mainText1={item.title}
                    mainText2={item.subtitle}
                    onClickMain={() => { window.location.href = `view/?id=${item.key}`; }}
                    onClickAction1={() => handleFavorite(item.key)}
                    onClickAction2={handleHistory}
                    onClickAction3={() => handleAddToCart(item.key)}
                    mainImage={item.image}
                  />
                </Cell>
              ))}
            </Row>
            )}
          </Grid>
        </DrawerAppContent>
        {toast && (
        <MaterialSnackbar message={toast} onClose={() => setToast('')} />
        )}
        {/*
        <MaterialFab
          icon={<MaterialIcon icon="note_add" />}
          style={{ position: 'absolute', right: 16, bottom: 16 }}
          onClick={() => window.location.href = 'create/'}
        />
        */}
      </TopAppBarFixedAdjust>
    </View>
  );
};
